import React from 'react';
import MYtineraryLogo from '../public/MYtineraryLogo.png'

function LandingPage() {
    return (
      <div className="App">
          <img src={MYtineraryLogo} className="mytinerary-logo" alt="logo" />
      </div>
    );
  }

  export default LandingPage;
